INSERT INTO `contracts` VALUES (1,6,'teacher Test','2024-07-22',5000.00,'month','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51);\">This Contract is made and entered into on July 19, 2024, by and between Safar AI (\"Company\") and John Doe (\"Teacher\").</span></p>','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51);\">The Employee agrees to act in accordance with this Agreement and with the best interests of the Employer in mind, which may require them to present the best of their skills, experience, and talents to perform all the duties required of the Position.</span></p>','<p>The Employee shall be given the job title of Teacher which shall involve:</p><ul><li>Providing educational instruction to students.</li><li>Developing curriculum and lesson plans.</li><li>Assessing and evaluating student progress.</li><li>Participating in meetings and professional development.</li></ul><p><br></p>','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51);\">The Employer agrees to hire the Employee on an at-will basis, which means this Agreement may be terminated at any time by either the Employee or Employer.</span></p>','<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51);\">As compensation for the services provided, the Employee shall be paid $5,000.00 per month. The Compensation is a gross amount that is subject to all local, State, Federal, and any other taxes and deductions as prescribed by law. Payment shall be distributed to the Employee on a monthly basis.</span></p>','<p>This Agreement shall be governed by and construed in accordance with the laws of the State of Delaware. Any disputes arising out of or in connection with this Agreement shall be resolved in the state or federal courts located in Delaware.','teacher test','Approved','2024-07-19 14:21:39','2024-07-22 15:06:52'),(9,41,'JEFFY','2024-08-07',50.00,'hour','<p><span class=\"ql-font-serif ql-size-huge\"