INSERT INTO `courses` VALUES (45,NULL,3,'Unit 1: Letters, Sounds, and Introductions','Grammar: The Alphabet and Pronunciation, Subject Pronouns (I, you, he, she)\r\nVocabulary: Basic words (apple, cat), simple greetings, personal introductions\r\nFocus: Recognizing sounds, basic greetings, and self-introductions',1,1,'weekly','2024-11-23 11:16:20','2025-02-05 14:15:20',1,'storage/uploads/6741b9843868e.png'),(48,NULL,4,'Unit 1: Talking About the Past','Grammar: Simple past tense with regular (played, worked) and irregular verbs (went, saw, ate); forming questions in the past simple (Did you go? What did she see?)\r\nFocus: Talking about completed actions and experiences in the past; asking and answering questions about past events\r\nTheme: My Last Vacation – Sharing past experiences and activities through questions and answers',1,2,'weekly','2024-12-07 10:46:33','2025-02-05 14:45:25',1,'storage/uploads/6754278922e06.png'),(51,NULL,4,'Unit 2: Describing Present Actions and Plans','Grammar: Present Continuous Tense (ongoing actions, future arrangements)\r\nFocus: Describing current activities and future plans\r\nTheme: My Weekly Schedule – Discussing routines, current events, and weekend plans.It\'s Sarah calling me',1,2,'weekly','2024-12-17 09:25:35','2025-02-05 14:45:26',1,'storage/uploads/6761438f03d11.png'),(52,NULL,4,'Unit 3: Expressing Frequency and Habits','Grammar: Adverbs of Frequency (always, usually, sometimes), “Used to” (for past habits)\r\nFocus: Talking about routines, frequency of actions, and past habits\r\nTheme: Daily Routines & Childhood Memories – Discussing regular habits and past routines.',0,2,'weekly','2024-12-17 13:25:15','2025-02-09 07:51:34',NULL,'storage/uploads/67617bbbc6a05.png'),(54,NULL,4,'Unit 4: Making Comparisons','Grammar: Comparatives and Superlatives (adjectives and adverbs)\r\nFocus: Comparing qualities and quantities of people, things, and experiences\r\nTheme: Comparing Favorites – Discussing best and worst experiences, places, and items.',0,2,'weekly','2024-12-21 12:50:08','2024-12-21 12:50:08',NULL,'storage/uploads/6766b98021aef.png'),(55,NULL,4,'Unit 5: Giving Suggestions and Advice','Grammar: Modals (Should, Shall, Ought to)\r\nFocus: Offering advice, making suggestions\r\nTheme: Planning an Event – Giving advice and ideas for events or social plans.',0,2,'weekly','2024-12-21 14:33:17','2024-12-21 14:33:17',NULL,'storage/uploads/6766d1adcd02d.jpeg'),(56,NULL,4,'Unit 1: Talking About the Past','Grammar: Simple past tense with regular (played, worked) and irregular verbs (went, saw, ate); forming questions in the past simple (Did you go? What did she see?)\r\nFocus: Talking about completed actions and experiences in the past; asking and answering questions about past events\r\nTheme: My Last Vacation – Sharing past experiences and activities through questions and answers',0,2,'weekly','2024-12-23 12:24:36','2024-12-23 12:24:36',NULL,'storage/uploads/676956849f99d.png'),(75,17,1,'History of Greece','mmmm',0,3,'intensive','2025-02-09 11:40:29','2025-02-09 12:07:58',1,'storage/uploads/67a8942db13bf.jpg'),(76,17,4,'تيست','تيست',0,6,'weekly','2025-02-10 08:01:49','2025-02-10 08:01:49',NULL,'storage/uploads/67a9b26db51a9.jpg');
