ed pancakes. Her mom cooked her favorite breakfast and served it with orange juice and a small cupcake with a candle. \"Make a wish!\" her mom said. Anna closed her eyes, smiled, and blew out the candle. In the afternoon, her best friends, Lucy and Sarah, surprised her with a visit. They brought balloons, flowers, and a beautiful cake. Anna laughed when she saw the funny message on the cake: \"Happy Birthday to the Queen of Pancakes!\" The party started at 5 p.m. Anna\'s family decorated the backyard with colorful lights and streamers. There was music, games, and delicious food. Everyone enjoyed a game of charades, and Anna’s little brother, Jack, made everyone laugh with his silly guesses. After dinner, Anna’s dad brought out a big chocolate cake. Everyone sang \"Happy Birthday,\" and Anna blew out the candles while making another wish. She opened her presents, which included a book from Lucy, a handmade bracelet from Sarah, and a pair of headphones from her parents. She loved every gift. As the evening ended, Anna and her friends sat under the stars, talking and laughing. They shared stories about their favorite birthdays. \"This is the best day of my life,\" Anna said as she hugged her friends and family goodbye. Anna still smiles whenever she remembers that special day.','text',11,NULL,'2025-02-09 11:06:31','2025-02-09 11:06:31'),(618,104,'test','test','voice',10,NULL,'2025-02-11 10:04:47','2025-02-11 10:04:47'),(619,102,'In 50 words, briefly describe the geography of Mesopotamia','Make sure to proofread your answer before submission','voice',11,NULL,'2025-02-11 10:05:01','2025-02-11 10:05:01'),(620,101,'test','test','voice',100,NULL,'2025-02-11 10:05:16','2025-02-11 10:05:16');
