INSERT INTO `units` VALUES (261,56,'Lesson 3','A Rainy Adventure','text','Default Block','<p><span class=\"ql-size-huge\">Irregular verbs have unique past tense forms that must be memorized.</span></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\">Common Irregular Verbs</strong></p><p><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">go</strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"> → </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>went</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;see</strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"> → </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>saw</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">eat</strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"> → </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>ate</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;have</strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"> → </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>had</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">do</strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"> → </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>did</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;put </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>put</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">come </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>came</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;take </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>took</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">drink </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>drank</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;buy </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>bought</u></strong><span class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"> </span></p><p><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">cut </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>cut</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;write </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>wrote</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">am </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>was</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;bring </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>brought</u></strong></p><p><strong style=\"color: rgb(0, 102, 204);\" class=\"ql-size-huge\">is </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\"><u>was</u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;are </strong><span style=\"color: rgb(0, 102, 204); background-color: transparent;\" class=\"ql-size-huge\">→ </span><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u>were</u></strong></p><p><br></p><p><em style=\"background-color: transparent;\" class=\"ql-size-huge\">I </em><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"><em><u>went</u></em></strong><em class=\"ql-size-huge\" style=\"background-color: transparent;\"> to the beach last summer.</em></p><p><em style=\"background-color: transparent;\" class=\"ql-size-huge\">They </em><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"><em><u>saw</u></em></strong><em class=\"ql-size-huge\" style=\"background-color: transparent;\"> a dolphin.</em></p><p><em style=\"background-color: transparent;\" class=\"ql-size-huge\">She </em><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"><em><u>bought</u></em></strong><em style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"> </em><em style=\"background-color: transparent;\" class=\"ql-size-huge\">a new dress yesterday.</em></p><p><em style=\"background-color: transparent;\" class=\"ql-size-huge\">He </em><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"><em><u>wrote</u></em></strong><em style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"> </em><em style=\"background-color: transparent;\" class=\"ql-size-huge\">a letter to her friend yesterday.</em></p><p><em style=\"background-color: transparent;\" class=\"ql-size-huge\">He </em><strong style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"><em><u>hit</u></em></strong><em style=\"background-color: rgb(204, 232, 204);\" class=\"ql-size-huge\"> </em><em style=\"background-color: transparent;\" class=\"ql-size-huge\">the ball hard during the game.</em></p><p><br></p><p><br></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(230, 0, 0); background-color: transparent;\"><img src=\"data:image/png;base64,\" width=\"326\" style=\"display: inline; float: left; margin: 0px 1em 1em 0px;\"></strong><strong class=\"ql-size-huge ql-font-serif\" style=\"color: rgb(230, 0, 0); background-color: transparent;\">A Rainy Adventure</strong></p><p><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">Last Saturday, Alex and Mia </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">went</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> </span><span style=\"color: rgb(0, 0, 0);\" class=\"ql-size-huge\">hiking </span><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">in the hills near their town. The day </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">began</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> with sunshine, and the sky </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">shone</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> brightly as they </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">rode</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> their bikes to the trailhead. They </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">took</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> their backpacks, which </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">held</strong><span class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"> sandwiches, water bottles, and a map.</span></p><p class=\"ql-align-justify\"><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">As they </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>climbed</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> higher, dark clouds suddenly </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">came</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> into view. The wind </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">blew</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> stronger, and soon, rain </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">fell</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> heavily. They </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">ran</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> to a small cave and </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">sat</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> inside, waiting for the rain to stop. While they </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>waited</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">, Alex </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">told</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> Mia a funny story about his last hiking trip. Mia </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>laughed</em></strong><em style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> </em><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">so hard that she nearly </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>spilled</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> her water bottle. When the rain finally </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>stopped</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">, they </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>decided</em></strong><em style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> </em><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">to head back home. Even though their hike </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">became</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> shorter than </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>planned</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\">, they </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">felt</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> happy to have </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\"><em>shared</em></strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> such an exciting day. \"I’m glad we </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">chose</strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"> to come out today,\" </span><strong style=\"color: rgb(0, 0, 0); background-color: rgb(255, 194, 102);\" class=\"ql-size-huge\">said</strong><span class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"> Mia.</span></p><p><br></p><p><br></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"><em>Verbs from the text :</em></strong></p><p><strong style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"><em>Irregular verbs</em></strong><em class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"> used in the past tense:</em></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">go → <u>went</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">begin → <u>began</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">shine → <u>shone</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">ride → <u>rode</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">take → <u>took</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">hold → <u>held</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">come → <u>came</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">become → <u>became</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">blow → <u>blew</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">fall → <u>fell</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">run → <u>ran</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">sit → <u>sat</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">tell → <u>told</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">feel → <u>felt</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">choose → <u>chose</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">say → <u>said</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\"><u> </u></strong></p><p><strong style=\"color: rgb(0, 0, 0); background-color: transparent;\" class=\"ql-size-huge\"><em>Regular verbs</em></strong><em class=\"ql-size-huge\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"> used in the past tense:</em></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">climb → <u>climbed</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">wait → <u>waited</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">decide → <u>decided</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">stop → <u>stopped</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">spill → <u>spilled</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">plan → <u>planned</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">share → <u>shared</u></strong></p><p><strong class=\"ql-size-huge\" style=\"color: rgb(0, 102, 204); background-color: transparent;\">laugh → <u>laughed</u></strong></p><p><br></p>',NULL,'2024-12-23 14:30:44','2025-02-08 14:16:44'),(262,48,'title','test','text','Default Block','<p><strong class=\"ql-font-serif\">test</strong></p>',NULL,'2025-02-05 14:17:22','2025-02-08 14:16:44'),(264,45,'Test Lesson',NULL,'text','Block 3',NULL,NULL,'2025-02-08 14:16:08','2025-02-08 14:16:08'),(265,75,'History of Greece','Clashes between Zeus and the Titans','text',NULL,'<p>للللللللللللباففففففففففففففففففففففففففففففففففف</p>','4444444444444444444444444444444444444444','2025-02-09 12:30:48','2025-02-09 13:15:19'),(266,75,'test','Clashes between Zeus and the Titans','video',NULL,NULL,'000000000000000000000000000000000','2025-02-09 12:35:55','2025-02-09 13:14:59'),(267,55,'History of Greece','The invention of wheels and coniform','text',NULL,NULL,NULL,'2025-02-10 14:22:26','2025-02-10 14:22:26'),(268,76,'gggg','ggggg','text',NULL,NULL,NULL,'2025-02-10 14:24:06','2025-02-10 14:24:06');
